INSERT INTO `reviews` VALUES (1,1,1,4,'dummy-1-1-0','Menarik joega ini lurrr',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(2,1,2,5,'dummy-1-2-1','bagaikan air di daun talas... event selesai menghilang tanpa bekas',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(3,1,3,4,'dummy-1-3-2','situ yang benar lah kalau bikin event',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(4,1,4,3,'dummy-1-4-3','Thanks for you guys’ efforts to make a successful the ISN2A 2020 conference. It is very different from many conferences that try to make money out of participants.',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(5,1,5,4,'dummy-1-5-4','Keep going you can make an advancement for the scientific community as well as your great country.',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(6,1,6,5,'dummy-1-6-5','Many thanks for the wonderful ISN2A 2020 conference in Caparica and for your kindness through the entire conference.',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(7,1,7,5,'dummy-1-7-6','Thank you very much for the nice conference and the interesting program.',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(8,1,8,4,'dummy-1-8-7','It was really nice to be part of this event and I hope I will be able to come again (in 2022 if I understood correctly)',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(9,1,9,4,'dummy-1-9-8','The ISN2A 2020 conference was excellent at all levels, top-scientific level, an ideal format for networking and in a spirit of a friendship!',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(10,1,10,3,'dummy-1-10-9','I just wanted to get in touch with you to express my gratitude and thanks for hosting such an amazing conference. I was overwhelmed with everything – the speakers, the hotel, the country and the food and wine. It was just amazing, and I really am going to work hard and come back to the PTIM2021 if you would have me',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(11,1,11,4,'dummy-1-11-10','We are pleasure to have the chance to attend the conference and give oral presentation. The conference gives us an amazing experience for meeting different countries researcher and colorful culture.Thanks a lot for your good organization.',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(12,1,12,3,'dummy-1-12-11','Thanks for your excellent organization of PTIM 2019. I came home safe and sound with good memories.',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(13,1,13,4,'dummy-1-13-12','See you in 2021.',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(14,1,13,5,'dummy-1-14-13','Attending PTIM 2019 has been a great experience for me. It was so nicely organised and scientifically strong conference in the field with a lot of networking opportunities. Many congratulations to you and your team for the overall success of the conference.',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(15,1,3,5,'dummy-1-3-14','Vala morghulis',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(16,1,3,1,'dummy-1-3-15','111',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(17,1,3,4,'dummy-1-3-16','any comment',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(18,2,10,2,'dummy-2-10-0','Cape woi disiksa pagi siang sore',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(19,2,11,4,'dummy-2-11-1','Cinlok is reaaaaal',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(20,2,12,2,'dummy-2-12-2','Tertipu janji manis',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(21,2,3,4,'dummy-2-3-3','Ternyata begini ya',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(22,8,1,3,'dummy-8-1-0','dicoba ah',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(23,8,1,4,'dummy-8-1-1','chaebol',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(24,3,1,4,'dummy-3-1-0','333',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(25,3,1,4,'dummy-3-1-1','111',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(26,3,1,4,'dummy-3-1-2','111',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(27,3,1,4,'dummy-3-1-3','111',1,'2023-08-13 17:00:00','2023-08-25 00:52:48'),(28,3,1,4,'dummy-3-1-4','222',1,'2023-08-13 17:00:00','2